import React from 'react';
import './App.css';
import FluenceMap from './FluenceMap.js'

class App extends React.Component {
  render() {
    return (
      <div>
        <FluenceMap
          row={
          [
            [4, 2, 3, 2, 4, 1, 3, 8],
            [4, 2, 3, 2, 6, 1, 3, 8],
            [3, 2, 3, 2, 7, 1, 3, 3],
            [4, 2, 3, 2, 1, 1, 3, 5],
            [3, 2, 3, 1, 3, 1, 3, 1],
            [4, 2, 3, 2, 1, 1, 3, 2],
            [3, 2, 3, 2, 1, 1, 3, 3],
            [4, 2, 3, 2, 9, 0, 0, 0]
          ]
          } />
      </div>
    )
  }   
}

export default App;
